  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:14.937175\",\n\t\"name\": \"osprey-nesting-missisquoi-national-wildlife-refuge-2007-2014\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"During 2007-2014, staff and volunteers
  of Missisquoi NWR, in coordination with the VFWD, observed and monitored the annual
  nesting activity of ospreys throughout the refuge. Ospreys usually arrived in Vermont
  in April and started nesting activities in early May. Osprey activity was observed
  by boat, from May to August, to determine: where osprey nests were located on the
  refuge, the number of active nests in late May, and the number of nests that successfully
  raised young to near-fledgling stage by late July.\",\n\t\"license_title\": \"License
